import {
    GoogleRecaptchaSection,
    SectionTitle,
    SectionForm,
    FormFieldset,
    FieldsetLabel,
    FieldsetInput,
    FieldsetButton
} from './style';

const Home = () => (
    <GoogleRecaptchaSection>
        <SectionTitle>Google Recaptcha</SectionTitle>

        <SectionForm onSubmit={formSubmit}>
            <FormFieldset>
                <FieldsetLabel>Type your name:</FieldsetLabel>

                <FieldsetInput name="name" />
            </FormFieldset>

            <FormFieldset>
                <FieldsetButton type="submit">Confirm</FieldsetButton>
            </FormFieldset>
        </SectionForm>
    </GoogleRecaptchaSection>
)

const formSubmit = event => {
    // console.log('data', data);

    console.log('event', event.target.elements);

    event.preventDefault();
}

export default Home
